import React from 'react'
import './SideBar.css'
import SideBarButton from '../SideBarButton'
import Pic from '../../assets/profile.png'
import {BrowserRouter as Link} from 'react-router-dom'

const SideBar = () => {
	return (
		<Link to="/profile">
		<div id="sideBarBackground">Hi
		</div>
		</Link>
	);
}

export default SideBar;
